import React from 'react';
import './custom-button.styles.scss';
import firebase from 'firebase/app';
import 'firebase/firestore';
import 'firebase/auth';

const config = {
    
        apiKey: "AIzaSyA8AHtNZ37wexIh79RmywlnLJufLCKzIYI",
        authDomain: "clothing-website-db.firebaseapp.com",
        databaseURL: "https://clothing-website-db.firebaseio.com",
        projectId: "clothing-website-db",
        storageBucket: "clothing-website-db.appspot.com",
        messagingSenderId: "474338000695",
        appId: "1:474338000695:web:8075e8a33f6240ef16a4b2",
        measurementId: "G-GGL2G28ZCB"
      
};

firebase.initializeApp(config);

export const auth = firebase.auth();
export const firestore = firebase.firestore();

const provider = new firebase.auth.GoogleAuthProvider();
provider.setCustomParameters({prompt: 'select_account'})
export const signInWithGoogle = () => auth().signInWithPopup(provider);
 
 
 

const CustomButton = ({ children, ...otherProps}) => (

    
        <button className='custom-button'
        >
              {children}  
        </button>
    
        );
export default  CustomButton;
